/// <summary>
///     Represents cell contents of work planner form.
/// </summary>
public final class JmgWorkPlannerCellContent
{
    private FormStringControl    control;
    private Description          data;

}

Method.Source:
public static JmgWorkPlannerCellContent constructFromValues(FormStringControl _control, Description _data)
{
    JmgWorkPlannerCellContent jmgWorkPlannerCellContent = new JmgWorkPlannerCellContent();

    jmgWorkPlannerCellContent.control = _control;
    jmgWorkPlannerCellContent.data = _data;

    return jmgWorkPlannerCellContent;
}

public static JmgWorkPlannerCellContent constructFromControl(FormStringControl _control)
{
    JmgWorkPlannerCellContent jmgWorkPlannerCellContent = new JmgWorkPlannerCellContent();

    jmgWorkPlannerCellContent.control   = _control;

    return jmgWorkPlannerCellContent;
}
